import NewGoal from "./NewGoal";
import "./GoalBox.css";
function GoalBox(props){
    const newGoalHandler = (goal)=>{
        props.addNewGoal(goal);
    }
    return(
        <div className="goal">
            <NewGoal newGoal={newGoalHandler}/>
        </div>
    );
}
export default GoalBox;
